import firebase from "firebase";
import { useEffect, useState } from "react";
import { Header } from "../Header";
import { List } from "./List";


interface Data {
  name: string,
  image: string,
  description: string
}

const datas: Array<Data> = [
  {
    name: '',
    image: '',
    description: ''
  }
]


export function Home() {

  async function test() {
    await firebase.firestore().collection("hai_shops").get().then((querySnapshot) => {
      querySnapshot.forEach((doc) => {
        datas.push({ 
          name: doc.data().name,
          image: doc.data().image,
          description: doc.data().description
        });
      });
    });
  }

  useEffect( () => {
    test();
  }, [])

  return (
    <div>
      {console.log(datas)}
        <Header />
        <List {...datas}/>
    </div>
  );
};
